import { useAuth } from 'react-auth-kit';
import UserContext from '../context/userContext';

const Home = () => {
    const { authState } = useAuth();
    const { name } = useContext(UserContext);

    return (
        <div className='mt-5'>
            {name}
        </div>
    );
};

export default Home;
